{"val":"const assert = require('assert');
const { somarEdobrar, subtrairEdividir } = require('../arquivoPrincipal2');


describe('Testes da Primeira funcao', function () {
    it('somarEdobrar com x e y positivos', function () {
        const resultado1 = somarEdobrar(8, 12);
        assert.equal(resultado1, 40);
    });

    it('somarEdobrar com x e y negativos', function () {
        const resultado2 = somarEdobrar(-10, -20);
        assert.equal(resultado2, -60);
    });

});


describe('Testes da Segunda funcao', function () {
    it('subtrairEdividir com x e y positivos', function () {
        const resultado1 = subtrairEdividir(20, 10);
        assert.equal(resultado1, 5);
    });

    it('subtrairEdividir com x e y negativos', function () {
        const resultado1 = subtrairEdividir(-30, -8);
        assert.equal(resultado1, -11);
    });

});
"}

