{"val":"// Executar uma soma  e multiplicacao simples
function somarEdobrar(primeiro, segundo) {
    let resultado = primeiro + segundo;
    resultado = resultado*2;
    return resultado;
}

// Executar uma subtracao e divisao simples
function subtrairEdividir(primeiro, segundo) {
    let resultado = primeiro - segundo;
    resultado = resultado/2;
    return resultado;
}

module.exports = {
    somarEdobrar,
    subtrairEdividir
};


